def pattern(s):
    l, r = 0, (-1) + len(s)
    while l < r:
        mid = (r - l) // 2 + l+ 1
        temp = s[mid:]
        for i in reversed(s[l:mid]):
            if i != temp[i]:
                return False
        l = mid
